//Footer componenet with active links
import Link from "next/link";

const Footer = () => (
  <div className="nav">
    <p>AllSound Visual</p>
    <Link href="https://github.com/T4lith4/">
      <a className="icon-link">
        <img
          className="icon"
          alt="github icon"
          src="/static/images/github.png"
        ></img>
      </a>
    </Link>
    <Link href="https://www.linkedin.com/in/talitha-kruger-3a7b07175/">
      <a className="icon-link">
        <img
          className="linkedin"
          alt="linked in icon"
          src="/static/images/linkedin.png"
        ></img>
      </a>
    </Link>

    <a
      href="mailto:talkruger9@gmail.com?Subject=Dear%20Talitha"
      target="_top"
      className="icon-link"
    >
      <img
        className="icon"
        alt="email icon"
        src="/static/images/email.png"
      ></img>
    </a>

    <style jsx>{`
      .nav {
        background: darkgrey;
        font-size: 25px;
        font-family: calibri;
        display: flex;
        justify-content: center;
        padding: 18px;
        width: 100%;
        
        position:absolute;
        bottom:0;
      }
      .linkedin {
        width: 35px;
      }
      img {
        width: 35px;
        margin-left: 50px;
      }
    `}</style>
  </div>
);

export default Footer;
